import React from 'react';
import { BrowserRouter as Router, Routes, Route, useNavigate } from 'react-router-dom';  // Import necessary components
import './App.css';
import Lottie from 'lottie-react';  // Import Lottie component
import animationData from './Animation.json';  // Your animation file

// Home Page Component
function HomePage() {
  const navigate = useNavigate();  // Hook to programmatically navigate

  return (
    <div className="App">
      {/* Navigation Bar */}
      <nav className="navbar">
        <div className="search-container">
          <input
            type="text"
            placeholder="Search..."
            className="search-bar"
          />
        </div>
      </nav>

      {/* Main content */}
      <div className="main-content">
        <h1>
          All things finance,<br /> right here.
        </h1>

        {/* Lottie Animation */}
        <div className="lottie-container">
          <Lottie
            animationData={animationData}
            style={{ height: '300px', width: '500px' }}
            loop={true}
            autoplay={true}
          />
        </div>

        {/* Get Started Button */}
        <button
          className="get-started-button"
          onClick={() => navigate('/next')}  // Navigate to the next page on click
        >
          Get Started
        </button>
      </div>
    </div>
  );
}

// Next Page Component
function NextPage() {
  return (
    <div className="next-page">
      <h1>Welcome to the Next Page!</h1>
      <p>This is where your next content will go.</p>
    </div>
  );
}

// Main App Component
function App() {
  return (
    <Router>
      <Routes>
        {/* Define Routes */}
        <Route path="/" element={<HomePage />} />
        <Route path="/next" element={<NextPage />} />
      </Routes>
    </Router>
  );
}

export default App;
